import React from 'react'
import './Sidebar.scss';
import sidebarimage from '../../../public/Image';

export const Sidebar = props => {
  return (
    <div className="sidebar">
      <h2>Image of the Week</h2>
      <img src={sidebarimage} width="100%" />
    </div>
  );
}

export default Sidebar
